import './InfoCell.css';

const InfoCell = () => {
  return(
    <div className='infoOuterContainer'>
      <div className='textContainer'>
        <div className='cellTitleText'>
          About Me
        </div>
        <div className='cellContentText'>
        I grew up in a bed and breakfast on lake Superior, and I learned the code of many things there. I learned the code of music by studying the violin. I discovered the code of color, line and form in our neighbours home, who were sculptors and painters by trade. In high school I learned the programming language of the TI-83 graphing calculator to make games and pattern generators. After college I learned a dialect of C++ for Arduion micro-controllers to create reactive light fixtures.

        </div>
      </div>
      <div className='photoContainer'>
      </div>
    </div>
  )
};

export default InfoCell;
